Information
------------------------------

Through the Wormhole: Series 1 (BDRip)
Academy Award-winning actor and space enthusiast Morgan Freeman executive produces hosts and narrates this exploration of the greatest mysteries of the universe. This new series, produced by Freeman's Revelations Entertainment, seeks the answers to the big questions: Are we alone? Where did we come from? Is there life on other planets? From the latest work at NASA and private enterprise facilities to the latest theories from academics and researchers, this series looks at black holes, colonizing the planets, string theory and more. Science Channel invites viewers on the journey as Morgan Freeman picks up where Carl Sagan's &quot;Cosmos&quot; left off and explores the new frontiers of what is beyond Earth. Through the Wormhole brings together the brightest minds and best ideas from the very edges of science - Astrophysics, Astrobiology, Quantum Mechanics, String Theory, and more - to reveal the extraordinary truth of our Universe.




4)  How Did We Get Here 
Everywhere we look in the most hospitable of environments and in the most extreme we find life. On Earth, life exists everywhere we look. Yet we have only ever found life on our planet. How did the stuff of stars come together to create life as we know it? What do we really mean by 'life'? And will unlocking this mystery help us find life elsewhere?



